INSERT INTO `groups` VALUES (1,'group1','1',NULL,NULL),(2,'group2','2',NULL,NULL),(3,'group3','a','a',NULL),(4,'group3','b','b',NULL),(5,'UCSB CS','2','For csil',NULL),(6,'UCSB CS','2','For csil',NULL),(7,'UCSB CS','2','For csil',NULL),(8,'UCSB CS','2','For csil',NULL),(9,'UCSB CS','2','For csil',NULL),(10,'UCSB CS','2','For csil',NULL),(11,'UCSB CS','2','For csil',NULL),(12,'UCSB CS','2','For csil',NULL),(13,'UCSB CS','2','For csil',NULL),(14,'UCSB CS','2','For csil',NULL),(15,'UCSB CS','2','For csil',NULL),(16,'UCSB CS','2','For csil',NULL),(17,'UCSB CS','2','For csil',NULL),(18,'UCSB CS','2','For csil',NULL),(19,'UCSB CS','2','For csil',NULL),(20,'UCSB CS','2','For csil',NULL),(21,'UCSB CS','2','For csil',NULL),(22,'UCSB CS','2','For csil',NULL),(23,'UCSB CS','2','For csil',NULL),(24,'UCSB CS','2','For csil',NULL),(25,'UCSB CS','2','For csil',NULL),(26,'UCSB CS','2','For csil',NULL),(27,'UCSB CS','2','For csil',NULL),(28,'UCSB CS','2','For csil',NULL),(29,'UCSB CS','2','For csil',NULL),(30,'UCSB CS','2','For csil',NULL),(31,'UCSB CS','2','For csil',NULL),(32,'UCSB CS','2','For csil',NULL),(477,'Group Name 1_SCALE_TEST','Catrgory 1','This is an example of a enthusiast community group. If you know me, then you know I’ve been a huge foodie way before my involvement with @KogiBBQ. A lot of us LA Tech people are always meeting up for dinners, tastings, and other random noms. To date, it’s always been organized by a mishmash of tweets, texts, calls or occasionally eventbrite . Inevitably, someone misses out. Solution? Create a space on Facebook, where we all have profiles, to suggest and coordinate around our meetups and share our love for good food! Within 20 minutes, we already had our first meetup scheduled! Since I like brands, I came up with a quick name and logo to bring it all together. I setup a Group Doc to list meetup ideas and used Group Events for setting up official meetups. Since it is an Open Group, anyone can see and share meetup details, local foodie posts, and join via any member. This allows us to coordinate and share both as a group and with potentially interested Facebook users. One nice aspect is t',NULL),(478,'Group Name 2_SCALE_TEST','Catrgory 2','This is an example of a enthusiast community group. If you know me, then you know I’ve been a huge foodie way before my involvement with @KogiBBQ. A lot of us LA Tech people are always meeting up for dinners, tastings, and other random noms. To date, it’s always been organized by a mishmash of tweets, texts, calls or occasionally eventbrite . Inevitably, someone misses out. Solution? Create a space on Facebook, where we all have profiles, to suggest and coordinate around our meetups and share our love for good food! Within 20 minutes, we already had our first meetup scheduled! Since I like brands, I came up with a quick name and logo to bring it all together. I setup a Group Doc to list meetup ideas and used Group Events for setting up official meetups. Since it is an Open Group, anyone can see and share meetup details, local foodie posts, and join via any member. This allows us to coordinate and share both as a group and with potentially interested Facebook users. One nice aspect is t',NULL),(479,'Group Name 3_SCALE_TEST','Catrgory 3','This is an example of a enthusiast community group. If you know me, then you know I’ve been a huge foodie way before my involvement with @KogiBBQ. A lot of us LA Tech people are always meeting up for dinners, tastings, and other random noms. To date, it’s always been organized by a mishmash of tweets, texts, calls or occasionally eventbrite . Inevitably, someone misses out. Solution? Create a space on Facebook, where we all have profiles, to suggest and coordinate around our meetups and share our love for good food! Within 20 minutes, we already had our first meetup scheduled! Since I like brands, I came up with a quick name and logo to bring it all together. I setup a Group Doc to list meetup ideas and used Group Events for setti